- input: TEXT,F3XA,,"In response to your letter please note that the memo tranfers
    have been amended to show the correct amount for each donor.  You have stated
    that the Committee failed to provide the aggregate for each donor.  Memo entries
    are recorded by FECFile with a zero aggregate and the total must be cauculated
    individually.  The program does not allow for an override of the aggregate total
    therefore we were unable to make the change.  In addition, you have asked for
    the election designation for each contributuion.  The Committee is an 'other political
    committee' therefore election designations are not available in the program.  The
    Committee operates under the guidelines established in FEC AO 1977-16 and after
    these contributions were received it affiliated with a campaign committee which
    recorded the contributions and designated them all as General election donations.  Please
    contact me with any questions.  Thank you."
